import FireApp from "./assets/logo.png";


function App() {
  return (
    <div>
      <div className="App-carousel">
        <h1>3D Image Carousel</h1>
        <ImageCarousel />
      </div>
      <div className="App-question-card">
        <GamePresenter />
      </div>
    </div>
  );
}

export default App;
